import React from 'react';

const Services = () => {
  return (
    <section id="services">
      <h2>Services</h2>
      <ul>
        <li>Web Development</li>
        <li>Mobile App Development</li>
        <li>UI/UX Design</li>
      </ul>
    </section>
  );
};

export default Services;
